import React  from "react";
import { Link } from "react-router-dom";

export function NavMenuModule({temas}){
    return(
        <React.StrictMode>
            <div>
            <nav>
            <ul>
                {
                    temas.map(type =>{
                        return(
                            <li>
                                <Link to={type.id.href}>{type.id.id}</Link>
                            </li>
                        )
                    })
                }
            </ul>
            </nav>
            </div>
        </React.StrictMode>
    )
}
